import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles/Dashboard.css";
import logo from "../assets/logo.jpg";
import carousel1 from "../assets/carousel1.jpg";
import carousel2 from "../assets/carousel2.jpg";
import carousel3 from "../assets/carousel3.jpg";

const Dashboard = () => {
  const navigate = useNavigate(); // Navigation Hook

  return (
    <div className="dashboard">
      {/* Header/Navbar */}
      <header>
        <div className="logo">
          <img src={logo} alt="Hunger Relief Logo" />
        </div>
        <nav>
          <ul className="nav-links">
            <li><a href="#" className="nav-item">Home</a></li>
            <li><a href="#" className="nav-item">About</a></li>
            <li><button className="donate-btn" onClick={() => navigate("/donate")}>Donate</button></li>
            <li><button className="logout-btn" onClick={() => navigate("/")}>Logout</button></li>
          </ul>
        </nav>
      </header>

      {/* Image Carousel */}
      <section className="carousel">
        <div className="carousel-container">
          <img src={carousel1} alt="Food Donation 1" />
          <img src={carousel2} alt="Food Donation 2" />
          <img src={carousel3} alt="Food Donation 3" />
        </div>
      </section>

      {/* Footer */}
      <footer>
        <p>Â© 2024 Hunger Relief. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Dashboard;
